import { NavLink } from "react-router-dom";
import classes from '../index.css';
const HomePage = () =>{
    return <>
        <h1 className="">HEllo Home Page!</h1>
        <ul className="">
            <li>
                <NavLink to="/events">Events</NavLink>
            </li>
        </ul>
    </>
}

export default HomePage;
